@model bayes_nn(xs, ys) = begin

    # nn_params = Vector{Any}(undef, 291)

    nn_params ~ MvNormal(zeros(192), .5 .* ones(192))
    # b1W2b2W3b3 ~ MvNormal(zeros(230), 4.0 .* ones(230))
    # #W2 ~ MvNormal(zeros(100), 4.0 .* ones(100))
    # #b2 ~ MvNormal(zeros(10), 4.0 .* ones(10))
    # #W3 ~ MvNormal(zeros(100), 4.0 .* ones(100))
    # #b3 ~ MvNormal(zeros(10), 4.0 .* ones(10))
    # W4 ~ MvNormal(zeros(10), 1.0 .* ones(10))
    # b4 ~ Normal(0, 1.0)

 #    nn_params[1:50]=W1
 #    nn_params[51:280]=b1W2b2W3b3
 # #   nn_params[61:160]=W2
 # #   nn_params[161:170]=b2
 # #   nn_params[171:270]=W3
 # #   nn_params[271:280]=b3
 #    nn_params[281:290]=W4
 #    nn_params[291:291]=[b4]

    preds = nn_forward(xs, nn_params) #Build the net
     ~ InverseGamma(3, 1)

    for i = 1:210#size(ys)[2]
        # ys[:,i] ~ MvNormal(preds[:,i], ^2 * I)
        ys[1,i] ~ truncated(Normal(preds[1,i],^2),0,1)
        ys[2,i] ~ truncated(Normal(preds[2,i],^2),0,1)
        ys[3,i] ~ truncated(Normal(preds[3,i],^2),0,1)
        ys[4,i] ~ truncated(Normal(preds[4,i],^2),0,1)
        ys[5,i] ~ truncated(Normal(preds[5,i],^2),0,1)
        ys[6,i] ~ truncated(Normal(preds[6,i],^2),0,1)
    end
end;


